ibs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"http://feeds.seodesignsolutions.com/~r/SeoDesignSolutionsBlog/~3/5s6Rr3nWUss/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:6:{i:0;a:5:{s:4:\"data\";s:8:\"Articles\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:24:\"Keyword Stemming and SEO\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:29:\"Search Engine Relevance Model\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:28:\"SEO and Contextual Relevance\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:25:\"SEO and Topical Relevance\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:5;a:5:{s:4:\"data\";s:15:\"Unique Keywords\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Fri, 19 May 2017 00:59:15 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"http://www.seodesignsolutions.com/blog/articles/topical-relevance-seo-and-keyword-stemming/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:487:\"For the purpose of SEO, context is a definitive factor that can (1) elevate your website past others competing for similar or related keywords (2) build topical domain authority and (3) increase conversion by having a higher number of pages occupying a larger percentage of market share for related keywords and queries. Create Topical Relevance <a href=\"http://www.seodesignsolutions.com/blog/articles/topical-relevance-seo-and-keyword-stemming/\" class=\"read-more-excerpt\">Read More</a>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeffrey_Smith\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:11759:\"<p>For the purpose of <a href=\"http://www.seodesignsolutions.com/\"><span id=\"urn:enhancement-675cf1bc-12c8-b129-883d-07e8f9c370fb\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_optimization\">SEO</span></a>, context is a definitive factor that can (1) elevate your website past others competing for similar or related keywords (2) build topical <a href=\"http://seodesignsolutions.com/blog/seo/develop-domain-authority/\">domain authority</a> and (3) increase <span id=\"urn:enhancement-52755389-69c7-5844-fc7d-c3f9ada3c8f9\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/conversion_marketing\">conversion</span> by having a higher number of pages occupying a larger percentage of market share for <a href=\"http://seodesignsolutions.com/blog/seo-basics/using-related-search-to-find-googles-most-search-keywords/\">related keywords</a> and queries.</p>\n<div id=\"attachment_2549\" style=\"width: 435px\" class=\"wp-caption aligncenter\"><a href=\"http://seodesignsolutions.com/blog/articles/topical-relevance-seo-and-keyword-stemming/\"><img class=\"size-full wp-image-2549\" title=\"keyword-stemming\" src=\"http://seodesignsolutions.com/blog/wp-content/uploads/2009/05/keyword-stemming.jpg\" alt=\"Create Topical Relevance for Keyword Stemming\" width=\"425\" height=\"282\" srcset=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2009/05/keyword-stemming.jpg 425w, http://www.seodesignsolutions.com/blog/wp-content/uploads/2009/05/keyword-stemming-300x199.jpg 300w\" sizes=\"(max-width: 425px) 100vw, 425px\" /></a><p class=\"wp-caption-text\">Create Topical Relevance for Keyword Stemming</p></div>\n<p>What degree of contextual extraction from <span id=\"urn:enhancement-5b65dde2-b5c2-290a-b2e9-3079555e88f8\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_technology\">search</span> engine snippets contributes to ambient or unintentional <span id=\"urn:enhancement-40bd1a5b-b768-0d26-0bf8-19ea6fe9d678\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_technology\">search</span> engine rankings? Considering that <strong>over 50% of keyword queries are unique</strong> and even <span id=\"urn:enhancement-2bd56aef-0865-56db-2e17-c05892a6ead7\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_technology\">search</span> engines have not seen them; information retrieval relies on <a href=\"http://seodesignsolutions.com/blog/how-to-reference-material/using-lsi-based-synonyms-for-on-page-semantic-relevance/\">contextual relevance</a> to determine a pages quality score determined by the domain authority.<span id=\"more-2553\"></span></p>\n<p><span id=\"urn:enhancement-b3f7226e-c6c5-778b-0c1f-2c5fc8eab9be\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/web_search_engine\">Search engine</span> optimization (<span id=\"urn:enhancement-f0f7cedc-6d10-eb93-077a-db5c67c8af55\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_optimization\"><a href=\"http://www.seodesignsolutions.com\">SEO</a></span>) involves fine tuning your pages for optimal performance in <span id=\"urn:enhancement-d214637f-6554-c500-8fa8-22e1827be56b\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_technology\">search</span> engines.  While many webmasters and <span id=\"urn:enhancement-1149af12-353c-0811-a736-415a7aea8933\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_optimization\">SEO</span>&#8216;s only focus on <strong>metrics you can measure</strong>, there is a holistic and alchemical element that occurs naturally over time when the value of each page blends and fuses to create topical islands of relevance. This topical relevance allows pages to rank for a plethora of key phrases unintentionally and deliver an array of traffic to fuel <span id=\"urn:enhancement-6143fbfa-ec02-278c-742a-4fd5c0ccce65\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/conversion_marketing\">conversion</span> for your website.</p>\n<p>There is a <strong>window of relevance</strong> that <span id=\"urn:enhancement-ad0c433f-d828-0783-3b84-b174987abafb\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_technology\">search</span> engines use to determine which content stays and which content goes. For example, pages from sites that have not been visited since 1997 without <span id=\"urn:enhancement-22e85bca-c455-d2d5-1bf8-e17241040c74\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/backlink\">inbound links</span>, references or any type of inference from peers (other sites) lack the necessary impact to remain a relevant result and are either minimized to <span id=\"urn:enhancement-e6079f90-a52a-b37a-552e-cfd0d04979af\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/ranking\">ranking</span> for 1-2 terms or are essentially pushed out of the index.</p>\n<p>On the contrary a new page from a trusted site or a new page from a site being linked to from other topical sites, social media sites, news aggregators, directories or editorially from various sources does have the needed ingredients to toggle the metrics necessary to be considered a relevant page and thus ensures its survival in the SERPs.</p>\n<p>Essentially, each page that crosses a <strong>relevance threshold</strong> for the on page and off page synergy starts to stem and rank for keywords found sparsely on that page. This translates into hit after hit for keyword that was not considered primary phrases for the page in question.</p>\n<p>This is typically referred to as <em>mid-tail to long-tail traffic</em>, however, this type of traffic can often exceed intentional (sought after) primary keywords consistently. In addition, using this aspect of how <span id=\"urn:enhancement-c790d089-46f9-d0ae-3ea8-bec8d436f2a6\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_technology\">search</span> engines scale relevance (before awarding a site a top <span id=\"urn:enhancement-8d571f11-be70-f9a8-44c1-4b8171b3df13\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/ranking\">ranking</span>) <a href=\"http://seodesignsolutions.com/blog/link-building/website-optimization-tips-for-link-building-and-seo/\">keyword stemming</a> should be utilized as a strategic advantage.</p>\n<p>Mapping out the most <a href=\"http://seodesignsolutions.com/blog/seo/seo-optimized/\">relevant shingles</a> to define your page to <span id=\"urn:enhancement-6e1d9ded-7819-36ab-f854-9d9057bfcd03\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_technology\">search</span> engines, then using accommodating anchor text (on page) within the site with internal links and reinforcing that with (off page) links from other sites with related topical reference (<span id=\"urn:enhancement-17b3569b-3e83-e307-f361-65dd904014b8\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/peer_review\">peer review</span>) creates authority for those keywords and key phrases.</p>\n<p>So, for those still trying to measure the <a href=\"http://seodesignsolutions.com/blog/seo-services/seo-pricing-why-seo-rates-cost-so-much/\"><span id=\"urn:enhancement-a8a160a9-67a7-a625-8b89-d410364fb8e6\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/return_on_investment\">ROI</span> of <span id=\"urn:enhancement-6eb552b2-cc90-eadc-d4e2-fc9291a05bee\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_optimization\">SEO</span></a> prematurely, the results are cumulative and essentially continue to overlap over time. The takeaway is, with the exceedingly high degree of click fraud occurring in <a href=\"http://seodesignsolutions.com/blog/internet-marketing/seo-ppc-advertising-branding-or-lead-generation/\"><span id=\"urn:enhancement-812a4ac3-0e71-9eff-5a40-e7e15ae7f600\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/pay_per_click\">PPC</span> </a>(up to 35% in some instances) taking control of how you communicate your pages purpose to <span id=\"urn:enhancement-04b30c8a-aeab-294a-634a-dcecedf33989\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_technology\">search</span> engines and how they evaluate your website (as a reference or authority) is an added benefit of <span id=\"urn:enhancement-070bf8a7-f77f-db88-c2b0-65cba254b692\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_optimization\">SEO</span>.</p>\n<p>For every keyword you target with purpose, 10 more are also pulled into the spotlight (which you can use to stem and pull up multiple related pages within your website into the top 10 results).</p>\n<p>What is <strong>the value of a top 10 <span id=\"urn:enhancement-ee37e751-aa90-687e-2a2d-0e57ae221939\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/ranking\">ranking</span></strong> you might ask? That all depends on how trafficked the keyword or the topic are. However, aside from <span id=\"urn:enhancement-ea9cc3e7-924d-275d-2da0-00e2152967fd\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/web_traffic\">visitors</span> typing in keywords and searching for those pages, <span id=\"urn:enhancement-b0d09fa5-55c7-0000-fc40-582268403e31\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_technology\">search</span> engines can evaluate when your content has passed the contextual point of relevance and will essentially return those pages as relevant results (when someone searches).</p>\n<p>With this in mind, you can target the low hanging fruit of today to capture the most competitive keywords in the long-run and create a pure win/win relevance model for your website.</p>\n<p>Viewing <span id=\"urn:enhancement-ad242e3d-4501-7a41-ce02-f1d0206c9ac0\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_optimization\">SEO</span> from this standpoint, you can reap the immediate short-term benefits of rankings funneling <span id=\"urn:enhancement-36b6f0ba-909a-b78e-de18-a6c125a7a9e8\" class=\"textannotation disambiguated wl-thing\" itemid=\"http://data.wordlift.it/wl068/entity/web_traffic\">visitors</span> to landing pages or take the approach of devouring market share so that &#8220;just in case&#8221; prospects <span id=\"urn:enhancement-b188756f-3abf-6432-0411-0d8e0935b559\" class=\"textannotation disambiguated wl-thing wl-no-link\" itemid=\"http://data.wordlift.it/wl068/entity/search_engine_technology\">search</span> for a particular topic; your website is there at the helm of all things related.</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.seodesignsolutions.com/~ff/SeoDesignSolutionsBlog?a=5s6Rr3nWUss:_yZ1XJfU3L8:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/SeoDesignSolutionsBlog?d=yIl2AUoC8zA\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/SeoDesignSolutionsBlog/~4/5s6Rr3nWUss\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"http://www.seodesignsolutions.com/blog/articles/topical-relevance-seo-and-keyword-stemming/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"28\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"http://www.seodesignsolutions.com/blog/articles/topical-relevance-seo-and-keyword-stemming/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"Block Segmentation, Duplicate Content, SEO and IR\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"http://feeds.seodesignsolutions.com/~r/SeoDesignSolutionsBlog/~3/5cAozBpoIes/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:7:{i:0;a:5:{s:4:\"data\";s:13:\"SEO Resources\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:31:\"Avoid Duplication Across Blocks\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:37:\"Search Engine Context and Duplication\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:3:\"SEO\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:26:\"SEO and Block Segmentation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:5;a:5:{s:4:\"data\";s:10:\"SEO and IR\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:6;a:5:{s:4:\"data\";s:36:\"SEO Term Frequency and Co occurrence\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Sun, 14 May 2017 06:55:18 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"http://www.seodesignsolutions.com/blog/seo-resources/seo-information-retrieval/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:446:\"Often you hear about the need to prevent duplicate content within your own website as it applies to SEO, but why? This is our take on why creating uniquely distinct nodes on each page is imperative for your content to produce not only context, but rankings as opposed to tripping search engine filters. Block segment <a href=\"http://www.seodesignsolutions.com/blog/seo-resources/seo-information-retrieval/\" class=\"read-more-excerpt\">Read More</a>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeffrey_Smith\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6111:\"<p>Often you hear about the need to prevent duplicate content within your own website as it applies to <a href=\"http://www.seodesignsolutions.com/\">SEO</a>, but why? This is our take on why creating uniquely distinct nodes on each page is imperative for your content to produce not only context, but rankings as opposed to tripping search engine filters.</p>\n<p><a href=\"http://seodesignsolutions.com/blog/seo-resources/seo-information-retrieval\"><img class=\"aligncenter size-full wp-image-9652\" src=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2009/04/uniqueness.jpg\" alt=\"duplicate content\" width=\"425\" height=\"282\" srcset=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2009/04/uniqueness.jpg 425w, http://www.seodesignsolutions.com/blog/wp-content/uploads/2009/04/uniqueness-300x199.jpg 300w\" sizes=\"(max-width: 425px) 100vw, 425px\" /></a></p>\n<p>Block segment analysis dictates the value of weight / ranking  factors a web page is given for a set portion of the page. For example, text in the header and footer of a document are treated differently than say text in the body section of a page.</p>\n<p>The header is given more weight than the footer and typically the body text is given more value than both (since that is where the page has the ability to distinguish itself from borrowed elements, i.e. navigation, etc.).<span id=\"more-1821\"></span></p>\n<p>The reason for this is simple, page composition dictates that proximity and distinction (the more unique one document is from another) by distinguishing your content, the better. Search engines can easily discern duplication (through shingle analysis, singular value decomposition, etc.) in areas such as navigation, sidebars/blogrolls with the same links and footers all using the same text. This has the tendency of diffuse a pages ranking potential.</p>\n<p>In order to leverage a page for <a href=\"http://www.seodesignsolutions.com\">SEO</a>, it must (1) get indexed and (2) stay indexed in order to pass its ideal <a href=\"http://seodesignsolutions.com/blog/seo/seo-theme-density-2/\">ranking factor</a>, be used to bridge ranking factor as a <a href=\"http://seodesignsolutions.com/blog/articles/hub-pages-for-seo/\">hub</a> by building <a href=\"http://seodesignsolutions.com/blog/seo-web-design/internal-links-are-you-making-the-most-of-yours/\">internal links</a> to and from that page. If search engines determine that your pages are redundant or ubiquitous the dampener kicks in algorithmically and the ranking factor can be suppressed via de-indexing or filters (<strong>like the supplemental index</strong>) as a basis of sequencing leaving the same repetitive hash mark (from document to document).</p>\n<p>This aspect of the ranking algorithm is based on the <a href=\"http://www.miislita.com/semantics/c-index-1.html\">c-index</a> whereby <a href=\"http://www.miislita.com/information-retrieval-tutorial/cosine-similarity-tutorial.html\">term weight</a> and similarity are used to assign relevance through <a href=\"http://mathworld.wolfram.com/SingularValueDecomposition.html\">singular value decomposition</a> as a base vector across web pages. If enough of the singular values are identified across the global collection of documents then you have co-occurrence (which may in this instance work against your ranking objectives).</p>\n<p>Duplication via a template or though tag pages that lack unique content can go supplemental in a secondary search index, if they are not nurtured with enough <a href=\"http://seodesignsolutions.com/blog/link-building/what-is-the-real-value-of-a-link/\">internal link flow</a>. The gist here is, the larger your website grows, the higher the probability of diffusing or diluting your global nodes / top ranking keywords (a.k.a <a href=\"http://seodesignsolutions.com/blog/search-engine-optimization/duplicate-content-and-shingle-analysis-for-seo/\">keyword cannibalization</a>) like an over-optimization penalty.</p>\n<p>Just like a base that shifts to accommodate scalability, the foundation (like a triangle) must continue to broaden its base if the vertical threshold continues to rise. Similarly, the more pages you add about (1) topic A shift the focus from topic B. The common thread in most websites is the navigation (which if left to a simplistic ontology is not sufficient to feed an entire website).</p>\n<p>You can stem a websites topic into multiple topics, however each has a threshold to cross and moving on many fronts requires more inbound links and internal stability though secondary navigation to <a href=\"http://seodesignsolutions.com/blog/seo/using-seo-to-sculpt-relevance-for-keyword-prominence/\">sculpt the on page factors</a> that identify each segments (to pass value).</p>\n<p>This is why <a href=\"http://seodesignsolutions.com/blog/search-engine-optimization-myths/you-cant-buy-credibility/\">virtual theming</a> (linking from relevant keywords in one document to another document) is so important. It allows the ranking factor to transfer link weight to the champion page through term frequency which essentially raises the bar in how search engines will interpret each respective keyword when considering it for retrieval.</p>\n<p>Deep linking (acquiring inbound links to a specific page vs. just the homepage) is equally as beneficial for eliminating the tendency for pages to go supplemental (or lose ranking factor as a unique asset). When you spread a site too thin (expand the content through automation) such as using a shopping cart that pulls similar values from a database. You must ensure that you have the ability to customize data (titles, h1, and content) to make each page distinct enough to add additional leverage to your primary, secondary and tertiary keywords that define your website.</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.seodesignsolutions.com/~ff/SeoDesignSolutionsBlog?a=5cAozBpoIes:1bPFb7KHJek:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/SeoDesignSolutionsBlog?d=yIl2AUoC8zA\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/SeoDesignSolutionsBlog/~4/5cAozBpoIes\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"http://www.seodesignsolutions.com/blog/seo-resources/seo-information-retrieval/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"13\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"http://www.seodesignsolutions.com/blog/seo-resources/seo-information-retrieval/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"How to Build Links and Optimize your Website for Multiple Keywords\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"http://feeds.seodesignsolutions.com/~r/SeoDesignSolutionsBlog/~3/fMke79EeF5s/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:5:{i:0;a:5:{s:4:\"data\";s:26:\"Search Engine Optimization\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:42:\"Google-Link-Building-Optimization-Strategy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:10:\"Google-SEO\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:45:\"How-to-Optimize-Website-for-Multiple-Keywords\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:14:\"seo-techniques\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Wed, 03 May 2017 05:00:26 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:133:\"http://www.seodesignsolutions.com/blog/search-engine-optimization/how-to-build-links-and-optimize-your-website-for-multiple-keywords/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:508:\"In case you were wondering how to systematically achieve saturation for multiple keywords for your website in search engines (instead of just a few) using SEO, then this is a must read post. This tactic is specifically designed to work in Google using the allinanchor / keyword relevance ratio to back links pointing at your <a href=\"http://www.seodesignsolutions.com/blog/search-engine-optimization/how-to-build-links-and-optimize-your-website-for-multiple-keywords/\" class=\"read-more-excerpt\">Read More</a>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeffrey_Smith\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:14799:\"<p>In case you were wondering how to systematically achieve saturation for <strong>multiple keywords</strong> for your website in search engines (instead of just a few) using <a href=\"http://www.seodesignsolutions.com/\">SEO</a>, then this is a must read post. This tactic is specifically designed to work in Google using the allinanchor / keyword relevance ratio to back links pointing at your site.<br />\n<a href=\"http://seodesignsolutions.com/blog/search-engine-optimization/how-to-build-links-and-optimize-your-website-for-multiple-keywords/\"><img src=\"http://seodesignsolutions.com/blog/wp-content/uploads/2008/11/multiple-keywords.jpg\" alt=\"\" title=\"Optimizing Multiple Keywords\" width=\"400\" height=\"275\" class=\"aligncenter size-full wp-image-617\" srcset=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2008/11/multiple-keywords.jpg 400w, http://www.seodesignsolutions.com/blog/wp-content/uploads/2008/11/multiple-keywords-300x206.jpg 300w\" sizes=\"(max-width: 400px) 100vw, 400px\" /></a><br />\nThis is the point where the competition gets nervous as a tactic like this could go viral with just one post from a popular Stumbler, Digg or otherwise. I will leave that at your discretion to cast your vote, but this is not the first time where I should have simply shut up, but I thought I would leave you with some good reading material for the weekend.<span id=\"more-93\"></span></p>\n<p>As an <a href=\"http://www.seodesignsolutions.com/seo/\">SEO</a> company involved in this illustrious industry, I feel like we owe those sincere seekers who yearn for legitimate <a href=\"http://www.seodesignsolutions.com\">SEO</a> techniques and only find dozens of sites with shallow posts, vague references and theory. I don&#8217;t mind sharing a few tactics here and there about <a href=\"http://seodesignsolutions.com/blog/how-to-reference-material/optimizing-your-website-for-multiple-keywords/\">keyword optimization</a>, as the tendency to create, test and implement them typically happens faster than I can write them down. </p>\n<p>This post in essence serves as a web-log of a fundamental technique, that we have used time and time again to bolster <a href=\"http://www.seodesignsolutions.com/seo-services.html\">multiple top 10 positions</a> in search engines.  Naturally, we have to hold back something, otherwise we would make the SEO community obsolete, but in any case, these tactics are what we use when targeting an entire industry for long tail search engine domination, they can also be used for more aggressive/competitive terms by <a href=\"http://seodesignsolutions.com/blog/link-building/should-you-build-links-for-competitive-terms-or-the-long-tail-of-search/\">using this tactic</a>. </p>\n<p>But, in the even that you wish to rank in the top 10 for a result that has 1.2 &#8211; 1.8 million results, you can essentially pick them off like flies using just a fragment of this technique. The terms we consider worthy are usually the ones that takes months to acquire. So, don&#8217;t build links to fast from off topic locations, it&#8217;s better to focus on quality vs. quantity, however having a diverse base of IP addresses to use is ideal (such as an article marketing resource box that you can moderate) Hmmmmm. </p>\n<p><strong>The exercise:</strong></p>\n<p>1. First start off by writing down every possible singular keyword that pertains to your industry. From there narrow it down to the top 20-30 terms. </p>\n<p>You could also just use a keyword discovery tool, but in this instance, think like a consumer trying to reach your site. The reason is, many of the search terms used to reach your site are unique and do not fall into realm of showing up on the &#8220;keyword radar&#8221;, so common sense can equal conversion if you pick the right phrase and beat your competition to the punch.</p>\n<p>2. Then after you have a list of 20-30, start combining two word combinations strategically using the premise of how you think someone may type a query into a search engine.</p>\n<p>web page optimization, optimize my website, how do I SEO my site, etc&#8230; come up with your wild card list of key phrases which you can have fun with later, since if you optimize your site for one group of keywords ALL OF THE KEYWORDS in the anchor text get a boost. So even though you may be <a href=\"http://www.seodesignsolutions.com/link-submissions-services.html\">building links</a> using exact match, you still get the benefit of each individual word in Google.</p>\n<p>3. After you have your list of 30 singular, 20 two-word combinations and 10 or so three-word combinations (just seeing if you were paying attention, since I didn&#8217;t say anything about the 3 word combinations) take each of the two and three word combinations, place the phrases &#8220;in quotes&#8221; and enter them in a standard Google search query one at a time. </p>\n<p>Look at the results of the keywords in quotes and this will give you a good indication of the allinanchor and allintitle relevance by using the quotes. Usually if you do this, you can remove the quotes and 90% of the sites remain the same. Without quotes it may be 1-10 of 2,000,000 results, with &#8220;the quotes&#8221; it may show 1-10 of 20,000. It is the term in quotes you want to look at in order to gain a metric on the competitiveness of this key phrase.</p>\n<p>Also, the more words you add, the easier it is to optimize, even if the chronology of the words does not make sense, you are still optimizing your site for any combination of keywords that are contained in the anchor text. In case it&#8217;s a new term, <a href=\"http://seodesignsolutions.com/blog/seo-marketing/how-to-use-article-marketing-for-building-links-traffic-seo-visibility/\">this is anchor text</a>, so use it wisely as it is your number 1 tool for developing links, relevance and rankings (for now at least) in Google.</p>\n<p>Getting back to the exercise, if the term comes back with under 100,000 results then move it into your to do list of links to build as a likely target for your SEO. Granted that this is merely one tactic, feel free to combine it with your own methods. Now, without giving away too many secrets, you will be responsible for finding ways to build links. </p>\n<p>Not just any links, but links that allow you to have control over the anchor text (the text in the link). Use these terms to whittle away at the root phrases building 100 links per keyword combination, then run analytics software of check out <a href=\"http://www.nichewatch.com/\">Niche Watch</a> and see where you stand using a before and after methodology. </p>\n<p>Every site is different, but say for example you have a PR6 site, you can skip most of these tactics and just put a keyword in your title tag, mention it a few times, build links from your own site to itself and dominate the SERPs. However, since we know that you are going to be challenging websites such as those in the SERPs as you step over them in concentration for allinanchor relevance as you specifically augment your site by fortifying it with keyword combinations, you can actually surpass a lazy or passive higher page rank site in this fashion. </p>\n<p>Our site for example can chip away and rise approximately 100,000 results per month for competitive terms using moderate link building methods (1000-2000 quality inbound links per month for example), so if we were going after a super competitive keyword such as <a href=\"http://www.google.com/search?hl=en&amp;client=firefox-a&amp;rls=org.mozilla%3Aen-US%3Aofficial&amp;hs=4gI&amp;q=%22seo+company%22&amp;btnG=Search\">&#8220;SEO Company&#8221;</a> for example with it&#8217;s 1.4 million results, it would take roughly 1 year to build links to get to the top 10 using this tactic. </p>\n<p>Each site is different as the authority that results from each link varies. The point here is, each website has a link velocity ratio that is consistent with how aggressively it can move up the rungs until it arrives in the top 10 search results for a keyword &#8220;in quotes&#8221;.</p>\n<p>If you wanted to find out where you stand for the keyword in advance, you could always click your url first, then use the search command <a href=\"http://www.google.com/ie?&amp;num=100\">www.google.com/ie?&amp;num=100</a> to get to the 100 results per page stripped down Google interface. From there (since you have clicked your link in advance) you can put the keyword in question &#8220;in quotes&#8221;, hit return and find out where you stand. </p>\n<p>If you are position #200 for example and you are building links for every word that comprises the phrase (services SEO, SEO Services, Search engine Optimization Services, Engine Optimization SEO, etc.) then you should see your ranking move up and up closer to the top 10 for a number of terms. </p>\n<p>When it hits the top 10 for the allinanchor: terms, if the keyword is not being challenged directly by another competitor your site should hit the top 10 as well. If there is competition you should be in the top 30 or top 20 results and you will have to figure out which other SEO factor <a href=\"http://seodesignsolutions.com/blog/seo-web-design/are-your-seo-on-page-factors-holding-you-back/\">is holding you back</a> from there.</p>\n<p>If you wanted to be more specific and chart your progress, you can find the link to link velocity ratio to determine how many links or how much time it will take you to crack into the top 10 for each of the respective search terms.  Or you could find the best page for each link using the Google command site:www.yoursite.com keyword, to increase the links per page (<a href=\"http://seodesignsolutions.com/blog/search-engine-optimization/link-building-deep-links-using-the-lpp-ratio/\">LPP ratio</a>) as a deep linking strategy to increase the impact of each link (don&#8217;t forget to socially bookmark them as well for an added boost).</p>\n<p>This is how you get your rankings to spread out to other terms. *If you use exact match terms for two word key phrases, then you can see the results usually within a week. The idea is, start with three words, when you see them moving, then alternate one of the keywords with another word from your list from before. So you can rank for keyword keyword company, keyword keyword services, keyword keyword professional, etc.</p>\n<p>Examples like SEO Marketing Consultant, SEO Website Marketing, Internet SEO Marketing, etc&#8230; this will become apparent later just how effective this tactic can be for blanketing a plethora of terms. </p>\n<p>Then you focus specifically on the phrase you want to rank for, create a custom page using a keyword density tool or writing copy that utilizes the phrase one time in the title, one time in the h1 tag, one to 3 times in the document and continue to build links to that page with those keywords in the anchor text. This is the advantage of having a blog as you can camouflage your link building tactics under the guise of an informative post. I will just hint at SEO content copy writing here, but you get the gist (link bait, social media, social bookmarking / link building ahem, ahem).</p>\n<p>My suggestion, build 50 links to the page and move on to another term. Then give it a week or two and go back and <a href=\"http://www.nichewatch.com/\">check the status of the keywords</a> and how your allinanchor:, allintitle: and allintext: ratio&#8217;s are performing is contrast to the keyword combinations, make note of your progress and try to find your site in the SERPs again. You can go back to the Google interface and check or you can just scroll through the normal results to see where you stand.</p>\n<p>If the keywords you select are under 20,000 results, if your site has some authority you can take those over from just posting an <a href=\"http://seodesignsolutions.com/blog/search-engine-optimization/titles-and-tagging-for-seo-conversion-relevance/\">on topic post that is tagged properly</a> in your blog. But to sustain them, you have to feed the pages keyword combinations to keep them afloat in the SERPs. This also provides a cushion around them to help fend off competition from leap-frogging past you up the ladder.</p>\n<p>Acquisition (climbing the rungs) and defense from others can be done through varying the tactic slightly. Slow down once you have acquired a top 20 and let the link velocity push you up the ladder. Then you can build 1/3 of the links using the exact match terms until you hit the top 10. If you crack the top 10, then go back, add a few more occurrences of the keywords you want to rank for in your document/page. Add a few more links, wait a week and then see if that pushes you over the hump into the top 5.</p>\n<p>This method may seem a bit chaotic, but you get the gist, you can manage one keyword or several at the same time. The key is to use a common denominator as the pivotal term that is used to tie together all of the variations of the word stemmed singular, plural and adjective based keyword combinations until you have effectively saturated each keywords density in the external links to your site.</p>\n<p>You can always check on Google Webmaster tools which keywords have the highest occurrences that are directed at your site. The idea is, to build a base term, add a qualifier, then do this again and again, until all of your main keywords are essentially lodged in the anchor text pointing at your site from a wide variety of unique and Class C- IP addresses.</p>\n<p>For example if you did a search on a term like &#8220;seo professional&#8221; this term returns 126,000 results. If your site has a PR4 for example and you have content that supports this type of industry of jargon in your domain name, on your pages or in your page titles, you should already have some leverage for the term.</p>\n<p>Terms that have slight correlation to your site&#8217;s theme can be optimized, but the rate of which all depends on your website authority, the links you use and how much link juice they carry, where you point them, the competition and how algorithms see your link building techniques (natural or unnatural) if you invoke a penalty, you will not rank for that term for a while until it&#8217;s lifted, so it&#8217;s better not to get greedy and vary your titles, anchor text and pages when deep linking.</p>\n<p>I hope you found this information useful, if you did, then cast your vote to share it, sign up for the RSS feed or just enjoy&#8230;See you in the SERPs.</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.seodesignsolutions.com/~ff/SeoDesignSolutionsBlog?a=fMke79EeF5s:vRkBGj361aA:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/SeoDesignSolutionsBlog?d=yIl2AUoC8zA\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/SeoDesignSolutionsBlog/~4/fMke79EeF5s\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:138:\"http://www.seodesignsolutions.com/blog/search-engine-optimization/how-to-build-links-and-optimize-your-website-for-multiple-keywords/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"58\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:133:\"http://www.seodesignsolutions.com/blog/search-engine-optimization/how-to-build-links-and-optimize-your-website-for-multiple-keywords/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"How to Get SEO, Call to Action and Conversion on the Same Page!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"http://feeds.seodesignsolutions.com/~r/SeoDesignSolutionsBlog/~3/WawDDa-5Yn0/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:6:{i:0;a:5:{s:4:\"data\";s:13:\"SEO Marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:14:\"call-to-action\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:23:\"Higher-Sales-Conversion\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:26:\"Problem-Solution-Marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:19:\"SEO-&-Squeeze-Pages\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:5;a:5:{s:4:\"data\";s:15:\"What-SEO-is-NOT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Mon, 01 May 2017 10:02:55 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:120:\"http://www.seodesignsolutions.com/blog/seo-marketing/how-to-get-your-seo-call-to-action-and-conversion-on-the-same-page/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:491:\"SEO is nice for popularity, but conversion is even better. So, before you go out and start snatching up more keywords than you can shake a stick at, make sure your offer is up to the challenge of enlivening customer attention and encouraging viewer retention. Otherwise, your marketing efforts will be a mere exercise in <a href=\"http://www.seodesignsolutions.com/blog/seo-marketing/how-to-get-your-seo-call-to-action-and-conversion-on-the-same-page/\" class=\"read-more-excerpt\">Read More</a>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeffrey_Smith\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:10528:\"<p><a href=\"http://www.seodesignsolutions.com\">SEO</a> is nice for popularity, but <strong>conversion is even better</strong>. So, before you go out and start snatching up more keywords than you can shake a stick at, make sure your offer is up to the challenge of enlivening customer attention and encouraging viewer retention. Otherwise, your marketing efforts will be a mere exercise in futility.</p>\n<p><a href=\"http://www.seodesignsolutions.com/blog/seo-marketing/how-to-get-your-seo-call-to-action-and-conversion-on-the-same-page/\"><img src=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2007/12/seo-and-conversion.jpg\" alt=\"seo and conversion\" width=\"400\" height=\"265\" class=\"aligncenter size-full wp-image-9645\" srcset=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2007/12/seo-and-conversion.jpg 400w, http://www.seodesignsolutions.com/blog/wp-content/uploads/2007/12/seo-and-conversion-300x199.jpg 300w\" sizes=\"(max-width: 400px) 100vw, 400px\" /></a></p>\n<p><strong>Are you playing it safe with keyword blinders?, or have you diversified your Search Terms?</strong></p>\n<p>It&#8217;s better to be safe than sorry as a result of <strong>&#8220;having blinders on&#8221;</strong> when it comes to <a href=\"http://seodesignsolutions.com/blog/search-engine-optimization/\">search engine optimization</a> and selecting the best keywords for your offer. Instead of thinking in terms of &#8220;the money phrase&#8221;, or, <strong>as soon as I hit the top 10</strong> for &#8220;my ultimate competitive keyword&#8221;, that floodgates of website traffic will open, sales will inundate our sales team and we will have to hire 20 people to scale our sales department to keep up with the surge of orders and traffic. This is not to say that things like this do not happen, they do, but rarely as a result of one keyword alone.<br />\n<span id=\"more-105\"></span></p>\n<p><strong>Don&#8217;t believe keyword hype</strong></p>\n<p>The misconception typically originates as a result of assumption, or misinformation gleaned from data mining tools / keyword research tools (it says this phrase gets 20,000 hits per month, so it must), which is understandable. I can assure you, we have dominated multiple rankings in top 10 competitive keywords with double organic listings, only to be disappointed by the lack of traffic that resulted. Yet, on the other hand, been completely surprised when you write  or optimize something (supposedly less competitive) and experience surges of traffic for weeks from one keyword you may or may not have expected.  </p>\n<p>It is important to be clear <strong>what search engine optimization is not</strong>, in order to know what it truly is. <strong>SEO is not the answer to conversion</strong>, it is just a tool to rouse the masses to investigate your offer, but ultimately the responsibility lies within the realm of the individual or individuals structuring the offer, to determine just what the anticipated end result will be.</p>\n<p><strong>Are your Pages Eye Candy? or do they Own a Focus</strong></p>\n<p>The internet is full of hungry eyes with agile minds attached, so many in fact, that your pages may just be another snack along the way. In order to change the menu and make your site <strong>&#8220;the main course&#8221;</strong>, nine times out of ten, some changes need to occur to make the transition from pages with an idle online existence to a page that for lack of better terms, offers you a deal you can&#8217;t refuse.</p>\n<p><strong>What Can You Learn (and apply to your own site) from a Squeeze Page</strong></p>\n<p><strong>First, the headline</strong> &#8211; <a href=\"http://seodesignsolutions.com/blog/small-business-marketing/action-words-and-conversion/\">Call to Action and Conversion</a> Starts Here. When you look at a typical squeeze page, once you get there, there is no question what the page is about, in fact they make it hard to see anything other than what the topical relevance is when you first set eyes on the page, but why? Because the headline takes up 25% of the screen, is usually in a ridiculously loud color, with quotes and highlighted in yellow. Anyone who fails at that point to surmise what the contextual relevance is for being there, should have their internet license suspended for surfing blind without emotional attachment. </p>\n<p>In any case, the point being, the pages, despite how obnoxious they are serve a very fundamental purpose, which is to set the tone and funnel the reader&#8217;s attention to the meat and potatoes of the document (typically found at the very bottom alongside a pay pal purchase button). This is were the old adage of (A.I.D.A) attention, interest, desire, action comes into play in it&#8217;s sublime simplicity. </p>\n<p><strong>Next, the testimonial</strong>, but why? Because they know you are skeptical and they know they need to subvert your defenses in order to engage the rational mind behind the emotional response when you shop (do I need this or do I want this, can I ignore or suppress the urge to purchase, or am I genuinely interested) all the while thousands of queries such as this race through the subconscious and either lead your to (a) move along (b) read further, since your there or (c) take the plunge and purchase, because, what the hay, it&#8217;s only money right.</p>\n<p><strong>Next, the problem / solution</strong>, which is usually built on the premise of using questions to preface it&#8217;s significance. Are you tired of? &#8220;the problem&#8221; Do you get frustrated when? Now you can be free of, by using our super duper X,Y,Z solution for mere chump change (only $39.95) for the ultimate answer to your prayers. </p>\n<p>O.k, so I was a bit over the top, but I&#8217;m sure it&#8217;s not the first time you have seen this pitch,  purchased or nearly purchased something as a result of it. Most of us are conditioned not to respond to such an overtly obvious pitch, however, I must admit, I am an impulse shopper and randomly purchase e-books in this fashion and never get around to reading them (the ideal customer for squeeze pages).</p>\n<p><strong>Then, the close,</strong> here is where they hit you with information about the product or service with the focus is on the &#8220;how you can benefit&#8221; mentality and inevitably the call to action, ORDER NOW!, ORDER TODAY, ORDER IN THE NEXT 5 MINUTES AND RECEIVE A FREE &#8220;rubber ducky, widget,etc.&#8221;, once again, it&#8217;s all about conversion.</p>\n<p>Sure that page may get 1000 visitors that day, and from that 1000 visitors <strong>100 order</strong>, that is more than enough to offset the other 900 that did not, so you can see the beauty in their plan. Pages like this could teach a great deal to businesses seeking conversion for their efforts instead of just visitors window shopping and burning up bandwidth, and I must admit even our pages in the main site need to take the positive benefits from such a blatant business model. The squeeze page is just that, a page that funnels their attention to a conclusion and then compels them to take action.</p>\n<p><strong>Have you heard of Funneling Attention for Higher Conversions? </strong></p>\n<p>Business models that make money are using the funneling tactic to amass massive amounts of income, using a tried and true / simplistic theme. Even though is mainly has it&#8217;s place in direct sales, affiliate programs, sales for e-books or inexpensive items. I have seen this tactic used for offers in the thousands and still convert readers (it just took more filler in the middle to build the argument and present the solution). Getting back to the basis of this article, the conclusion is SEO does not ensure conversion, it merely sets the stage.</p>\n<p>Branding is one thing, but how many people are online just for the sake of saying &#8221; I am the number one brand for industry X&#8221;, perhaps this is important for corporate America, sure, but,for the rest of us out here trying to make ends meet, we need conversion in some way shape or form.</p>\n<p>Knowing this, instead of thinking narrow when it comes to using SEO, one could opt for a more holistic approach whereby they identify the behavior of the types of clients they would like to attract, thinking of individuals as opposed to demographics from a one dimensional prospective. If you think holistically, you can cover your bases and <a href=\"http://seodesignsolutions.com/blog/search-engine-optimization/are-you-google-sighted-or-can-you-see-the-big-picture-of-search/\">optimize entire segments of the niche</a> as well as use multiple tactics and search engines to draw traffic from a variety of queries and implement &#8220;attention and retention insurance&#8221; for all of your respective offers. </p>\n<p>For example, instead of one or two phrases, why not have twenty instead, it essentially takes about the same amount of effort and can be accomplished through modifying slight variations of content and <a href=\"http://seodesignsolutions.com/blog/search-engine-optimization/how-to-build-links-and-optimize-your-website-for-multiple-keywords/\">how your build links</a>.</p>\n<p>Just having a top 10 ranking does not ensure traffic, simply because, not all keywords convert! It truly is sad to see so many people just scratching the surface for topical relevance, when in reality mosts sites are capable of acquiring heightened depth (for readership) and conversion and could achieve 400% more times the amount of traffic from just applying rudimentary steps to lead people through the &#8220;expected action for that page&#8221;. But, they have to get there first, so my suggestion in a nutshell is, to <strong>optimize root phrases with pertinent keywords</strong> instead of simple &#8220;exact match key phrases&#8221;, use strong internal links to get viewers deeper into the site and use graphics or video&#8217;s to cut the bounce rates in half.</p>\n<p>We will continue along these lines for the next few days and covering topics related to SEO, conversion, structuring your offer and how the way you craft your content, ultimately impacts the bottom line. Stay tuned for the next post&#8230;</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.seodesignsolutions.com/~ff/SeoDesignSolutionsBlog?a=WawDDa-5Yn0:cNEDoVaKCcc:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/SeoDesignSolutionsBlog?d=yIl2AUoC8zA\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/SeoDesignSolutionsBlog/~4/WawDDa-5Yn0\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:125:\"http://www.seodesignsolutions.com/blog/seo-marketing/how-to-get-your-seo-call-to-action-and-conversion-on-the-same-page/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"35\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:120:\"http://www.seodesignsolutions.com/blog/seo-marketing/how-to-get-your-seo-call-to-action-and-conversion-on-the-same-page/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"Don’t Get Left Behind! Upgrade to SEO Ultimate+\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"