:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"http://www.seodesignsolutions.com/blog/link-building/managing-link-weight-and-building-link-insurance/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:444:\"I Just wanted to share a quick SEO strategy for balancing link weight. Have you ever used a tiered link strategy? Although there may be other names for it, personally, I call this link insurance (insurance in the sense that just in case you need it). Since the value of links is all based on <a href=\"http://www.seodesignsolutions.com/blog/link-building/managing-link-weight-and-building-link-insurance/\" class=\"read-more-excerpt\">Read More</a>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeffrey_Smith\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5536:\"<p>I Just wanted to share a quick <a href=\"http://www.seodesignsolutions.com\">SEO</a> strategy for <strong>balancing link weight</strong>. Have you ever used a tiered link strategy? Although there may be other names for it, personally, I call this <strong>link insurance</strong> (insurance in the sense that just in case you need it).<br />\n<a href=\"http://www.seodesignsolutions.com/blog/link-building/managing-link-weight-and-building-link-insurance/\"><img class=\"aligncenter wp-image-9603 size-full\" src=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2008/05/link-weight-link-insurance.jpg\" alt=\"link-weight-link-insurance\" width=\"400\" height=\"346\" srcset=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2008/05/link-weight-link-insurance.jpg 400w, http://www.seodesignsolutions.com/blog/wp-content/uploads/2008/05/link-weight-link-insurance-300x260.jpg 300w\" sizes=\"(max-width: 400px) 100vw, 400px\" /></a></p>\n<p>Since the value of links is all based on the collective support they rally. The stronger the backlink the more value it can pass to your site as far as aiding your pages in maintaining or increasing positioning.<span id=\"more-204\"></span></p>\n<p>If you have ever tagged a site using social bookmarking, then you have scratched the surface. For example social bookmarking utilizes the premise of <strong>link insurance</strong>. Not only is it great to seal the deal with spiders (by getting their attention), but with enough inbound links strategically augmenting a page, it can provide long-term value for the <strong>link-freshness factor</strong> which can keep your internal pages buoyant and moving up in the search engine rankings.</p>\n<p>A stable authority site (built over time with a tremendous amount of link weight) has less chance of losing favor with search engine algorithms. However, what about other transient links, that drop off, get buried over time or the site architecture from the site offering the link is so taxed that by the time the pages are spidered <strong>they are tapped out</strong> as far as their real value is concerned? What is a viable solution to revive potential rankings?</p>\n<p><strong>The Solution: Building links to your links as insurance</strong></p>\n<p>I am not suggesting to abuse this tactic, what I am insinuating is, maintaining a stable influx of link juice into a site benefits all of the pages in that site (as long as you distribute the inbound links in moderation). The premise here is, <a href=\"http://seodesignsolutions.com/blog/link-building/balancing-link-diversity-link-velocity-and-link-volume/\">balancing</a> the ratios of content development to inbound links (and their various anchor and modifiers) along with systemic deep linking is the cornerstone of relevance of <a href=\"http://seodesignsolutions.com/blog/seo-basics/seo-basics-using-allinanchor-allintitle-allintext/\">SEO basics</a> in action.</p>\n<p>Links also can have more internal value from a page that was recently promoted in the Google algorithm. For example, if a page went from a page rank of zero to a PR2 or PR3 page in one update, if it gets indexed regularly and is succinctly tied to the sites main navigation, then you have an authority link right under your nose you can use to augment your main keywords as you wish.</p>\n<p>You can always review such content an amend it for a common goal. Ten links from <a href=\"http://seodesignsolutions.com/blog/link-building/using-deep-links-to-summon-search-engine-spiders/\">strong internal pages</a> to a sub folder or page buried deep in the site can change the landscape of a page or sites SEO value. Combining this with the fact that you can point new links from those pages at older links (to keep them fresh) or use them to kick off new content with a splash, the possibilities for recycling your sites internal link dynamo is promising.</p>\n<p><strong>One Example of the Equation:</strong></p>\n<p><strong>1)</strong> Find a slouching ranking and determine a keyword you want to invigorate<br />\n<strong>2)</strong> use a site:yourdomainname.com keyword (command) to find the most relevant page in your site<br />\n<strong>3)</strong> Build a new page using the <strong>main keyword in the title and text</strong><br />\n<strong>4)</strong> Link to the new page from the old page (with page rank) using the (keyword) as the anchor text / link text<br />\n <strong>5)</strong> publish your content<br />\n<strong>6)</strong> build links back to the old page (using social bookmarking or other ethical link building methods) to flow link weight back to your site and your new page.</p>\n<p>When the page gets crawled, it already has the ranking factors intact, relevance and an endorsement from your own internal links. This is a great strategy for a maiden voyage for a new page, although this is a rudimentary version of the tactic, you can see the value in building links to your links.</p>\n<p>Every three months, you could essentially go back through your analytics, look at the most searched keywords, perform an audit and ensure that your older links are getting enough nurturing as a result of fresh links. The stronger they are the stronger your site is.</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.seodesignsolutions.com/~ff/SeoDesignSolutionsBlog?a=SbAgitQy41g:ytdtE7dvXFE:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/SeoDesignSolutionsBlog?d=yIl2AUoC8zA\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/SeoDesignSolutionsBlog/~4/SbAgitQy41g\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"http://www.seodesignsolutions.com/blog/link-building/managing-link-weight-and-building-link-insurance/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"30\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"http://www.seodesignsolutions.com/blog/link-building/managing-link-weight-and-building-link-insurance/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";