e_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3193:\"<div class=\"hero_block row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\" text-center\"><iframe style=\"height: 378px;\" src=\"//fast.wistia.net/embed/iframe/ohcncbte4x?videoFoam=true\" allowtransparency=\"true\" frameborder=\"0\" scrolling=\"no\" class=\"wistia_embed\" name=\"wistia_embed\" allowfullscreen=\"\" mozallowfullscreen=\"\" webkitallowfullscreen=\"\" oallowfullscreen=\"\" msallowfullscreen=\"\" width=\"780\" height=\"376\"></iframe><script src=\"//fast.wistia.net/assets/external/E-v1.js\"></script></div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"hero_block row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\" text-center\" style=\"margin-top:0;margin-bottom:0;\"><a target=\"_blank\" href=\"https://seodesignframework.leadpages.co/leadbox/140f2faf3f72a2%3A12d9628a0b46dc/5712601648463872/\"><img src=\"https://lh3.googleusercontent.com/Y6docUak9NStgqgsc_2rDYRGMDTptUvMuJQkJ4q5PjEZrph49fgpg58ab75DTgrtBvY_WmikaTdIimQw3wiJHA=s0\"/></a></p>\n<p><script data-leadbox=\"140f2faf3f72a2:12d9628a0b46dc\" data-url=\"https://seodesignframework.leadpages.co/leadbox/140f2faf3f72a2%3A12d9628a0b46dc/5712601648463872/\" data-config=\"%7B%7D\" type=\"text/javascript\" src=\"https://seodesignframework.leadpages.co/leadbox-886.js\"></script></div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"hero_block row last_row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\" text-left\" style=\"margin-top:5px;\">\n<p>I know it&#8217;s been quiet on our blog, but, just to let you know&#8230;.we&#8217;ve been busy creating our new <strong>[10 Video] Advanced <a href=\"http://www.seodesignsolutions.com\">SEO</a> Training Series for SEO Ultimate</strong> and <a href=\"https://www.seoultimateplus.com/\" data-mce-href=\"https://www.seoultimateplus.com/\">SEO Ultimate+</a> so that people can really see the power of this amazing All-in-One solution for WordPress.</p>\n<p>I&#8217;ve added a teaser video above where I show you how to use the Deeplink Juggernaut&#8217;s <strong>Instant Post Propulsion</strong> technique to create auto-links for specific keywords (as well as dampen the volume of linking with the content link settings option).</p>\n<p>To get access to the entire 10 video series, just use the big blue button above to opt in. In the series we cover everything from:</p>\n<ul>\n<li>How to mass edit titles and meta tags.</li>\n<li>Indexation and crawl prioritization tips to prevent penalties.</li>\n<li>An introduction to structured markup.</li>\n<li>A walk-through of the new OpenGraph+ and Rich Snippets Creator modules&#8230;</li>\n</ul>\n<p>and much much more. But, you have to get access to the series first (which you can do using the <strong>Get More Training Like This</strong> button above).</p>\n<p>All the best,</p>\n<p>Jeffrey</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.seodesignsolutions.com/~ff/SeoDesignSolutionsBlog?a=LfAszNY6W9E:K62Ns01kLv4:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/SeoDesignSolutionsBlog?d=yIl2AUoC8zA\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/SeoDesignSolutionsBlog/~4/LfAszNY6W9E\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:105:\"http://www.seodesignsolutions.com/blog/wordpress-seo/the-seo-ultimate-advanced-seo-video-training-series/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"Why Good Enough Just Isn’t Good Enough Anymore!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"http://feeds.seodesignsolutions.com/~r/SeoDesignSolutionsBlog/~3/h51XQfdCDXU/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Articles\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Wed, 01 Jul 2015 09:36:17 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"http://www.seodesignsolutions.com/blog/?p=9510\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:474:\"You Can&#8217;t Be Serious? Let&#8217;s face it, times have changed and what worked yesterday has no guarantee of remaining relevant and working tomorrow. What most of us often overlook is that as the web evolves so does our nervous system and how it maps the priorities of how we communicate. Essentially, we develop blinders to <a href=\"http://www.seodesignsolutions.com/blog/articles/why-good-enough-just-isnt-good-enough-anymore/\" class=\"read-more-excerpt\">Read More</a>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeffrey_Smith\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2891:\"<div class=\"hero_block row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<figure class=\"image-module\">\n<div><img src=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/07/hooking-consumers.jpg\" class=\"image-module img-responsive square img-center\" data-no-retina title=\"\" alt=\"Consumers Can See Through the Bait\"></div>\n</figure>\n</div>\n<div class=\"col-md-12\">\n<div class=\" text-center\">\n<p>You Can&#8217;t Be Serious?<br data-mce-bogus=\"1\"/></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"hero_block row last_row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\" text-left\">\n<p>Let&#8217;s face it, times have changed and what worked yesterday has no guarantee of remaining relevant and working tomorrow.</p>\n<p>What most of us often overlook is that as the web evolves so does our nervous system and how it maps the priorities of how we communicate. Essentially, we develop blinders to keep us sane from information overload.</p>\n<p>Just like banner blindness is real, your ads, links, headlines, images and everything else <em>needs to be more human than ever</em> and have a more <strong>down to earth appeal</strong> vs. I&#8217;m selling you something (as if you don&#8217;t know it) if you ever want to see genuine conversions (which is why native advertising has displaced traditional ads).</p>\n<p>Yesterday&#8217;s marketing founded from the Madmen in the 60&#8217;s in today&#8217;s cinema plays like a bad dream we&#8217;ve been stuck in and trying to wake up from. </p>\n<p>The speaking at you vs. to speaking to you was blatantly overstated by them telling you what to do rather than listening and responding to your needs.</p>\n<p>So&#8230;making the shift from the old paradigm to the new paradigm of marketing is the basis of true engagement (<em>without offending your audiences intelligence)</em> as well as one of the safest ways to promote your brand while preserving its integrity.</p>\n<p>So, I challenge you to <strong>go back through your copy</strong>, your website and your communications and see whether or not you were writing it for YOU or for your CUSTOMERS?</p>\n<p>Just realize, it&#8217;s not too late&#8230; it&#8217;s just time to dust off your keyboard and make some worthwhile edits to boost conversions.</p>\n<p>The million dollar question is, are you writing what you THINK they want to hear, or communicating with clarity that they need to make an informed purchase?</p>\n<p>Until the next time.</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.seodesignsolutions.com/~ff/SeoDesignSolutionsBlog?a=h51XQfdCDXU:sgo_RwnERfM:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/SeoDesignSolutionsBlog?d=yIl2AUoC8zA\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/SeoDesignSolutionsBlog/~4/h51XQfdCDXU\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"http://www.seodesignsolutions.com/blog/articles/why-good-enough-just-isnt-good-enough-anymore/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"SEO Ultimate Launches Premium Version Called SEO Ultimate+\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"http://feeds.seodesignsolutions.com/~r/Se