ashboard. The video above covers the free update, however, to see the premium version, keep scrolling <a href=\"http://www.seodesignsolutions.com/blog/wordpress-seo/new-update-plus-seo-ultimate-is-going-premium-up-up-and-away/\" class=\"read-more-excerpt\">Read More</a>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeffrey_Smith\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:10438:\"<div class=\"hero_block row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\" text-left\">We&#8217;re feeling SUPER (no tens inpunded&#8230;) and just wanted to give you all a quick <strong>heads up</strong> that there&#8217;s a new version of <strong><a href=\"http://www.seodesignsolutions.com\">SEO</a> Ultimate Version 7.6.5.7</strong> available for download from the <a href=\"https://wordpress.org/plugins/seo-ultimate/\">WordPress repository</a> or via your WordPress plugin dashboard.</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"hero_block row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\" text-center\"><iframe style=\"height: 400px;\" src=\"//fast.wistia.net/embed/iframe/qd5yjgfos1?videoFoam=true\" allowtransparency=\"true\" frameborder=\"0\" scrolling=\"no\" class=\"wistia_embed\" name=\"wistia_embed\" allowfullscreen=\"\" mozallowfullscreen=\"\" webkitallowfullscreen=\"\" oallowfullscreen=\"\" msallowfullscreen=\"\" width=\"700\" height=\"398\"></iframe><script src=\"//fast.wistia.net/assets/external/E-v1.js\"></script></div>\n</div>\n<div class=\"col-md-12\">\n<div class=\" text-center\">The video above covers the free update, however, to see the premium version, keep scrolling ;)</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"hero_block row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\" text-left\">\n<p>As the numeric code implies (since it&#8217;s only incremental) that even though there were some <em>minor bug fixes</em>, this was mostly a cosmetic update to the plugin. </p>\n<p>You&#8217;ll find a few new resources and tools available for you in the SEO Admin Bar <strong>that we cover in the video above</strong>. Also, we&#8217;ve also covered some of the new tools that are accessible from the SEO admin bar. </p>\n<p></p>\n</div>\n</div>\n<div class=\"col-md-12\">\n<div class=\"headline clearfix text-left\">\n<h1>SEO Ultimate Goes Premium!</h1>\n</div>\n</div>\n<div class=\"col-md-12\">\n<div class=\" text-left\">\n<p>Granted, truth be told, the real heavy lifting from this point on is going into <strong>the premium version of the plugin</strong> called <a href=\"https://www.seoultimateplus.com\" data-mce-href=\"https://www.seoultimateplus.com\">SEO Ultimate+</a>. We&#8217;re not going to pull any features, but all new ones move to +.</p>\n<p>For example, there&#8217;s over 7 months of coding time on one module to rewrite the base code of the Open Graph Integrator which has now shifted into its next embodiment&#8230;. (<em>like a caterpillar to a butterfly</em>) the <strong>OpenGraph+ Module</strong> which you can <a href=\"https://www.seoultimateplus.com/screencaps/\" data-mce-href=\"https://www.seoultimateplus.com/screencaps/\">see here</a>, with features like &#8230;</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"hero_block row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\"headline clearfix text-center\">\n<h3 style=\"font-size:34px;font-family:Open Sans;color:#222222;margin-top:15px;margin-bottom:10px;\"><strong>Enjoy Simple, Easy-to-Implement Twitter Cards!</strong></h3>\n</div>\n</div>\n<div class=\"col-md-12\">\n<figure class=\"image-module\">\n<div><img src=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/twitter-summary-card.jpg\" class=\"image-module img-responsive square img-center\" data-no-retina title=\"\" alt=\"Create All 7 Twitter Cards with SEO Ultimate+\"></div>\n</figure>\n</div>\n<div class=\"col-md-12\">\n<div class=\" text-center\" style=\"margin-top:5px;\">\n<p>Now You Can Make Twitter Cards (all 7 types) with Ease! With No Fuss and No Mess!</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"hero_block row\" style=\"padding-top:5px;\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\"headline clearfix text-center\">\n<h3 style=\"font-size:34px;font-family:Open Sans;color:#222222;margin-top:15px;margin-bottom:25px;\"><strong>More Powerful Page Level Settings</strong></h3>\n</div>\n</div>\n<div class=\"col-md-12\">\n<div class=\" text-left\" style=\"margin-top:20px;margin-bottom:20px;\">\n<p>The premium version <strong><a href=\"https://www.seoultimateplus.com\" data-mce-href=\"https://www.seoultimateplus.com\">SEO Ultimate+</a></strong> handles Google+ customization, <strong>Open Graph / Facebook</strong> integration (on a page-by-page, post-by-post or mass edits 100 pages at a time).</p>\n<p>You can create all 7 types of Twitter cards&#8230;<strong>like a BOSS </strong>(<em>that validate flawlessly</em>) as well as there&#8217;s a powerful new arsenal of <strong>rich snippets </strong>to shoot up the SERPs ranging from <strong>Local SEO (Business), Events, Organization, People, Products, Recipes, Reviews, Software</strong> and <strong>Video</strong> (with more to come).</p>\n</div>\n</div>\n<div class=\"col-md-12\">\n<figure class=\"image-module\">\n<div><img src=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/Local-Page-Rich-Snippets.png\" class=\"image-module img-responsive square img-center\" data-no-retina title=\"\" alt=\"SEO Ultimate Page Level Rich Snippets\"></div><figcaption>\n<div class=\"view-more\"><a href=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/Local-Page-Rich-Snippets.png\" class=\"pretty-view clearfix\" data-rel=\"prettyPhoto\">View more</a></div>\n</figcaption></figure>\n</div>\n</div>\n</div>\n</div>\n<div class=\"hero_block row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\" text-left\" style=\"margin-top:20px;margin-bottom:20px;\">\n<p>There’s even a global fallback in SEO Ultimate+ in case you forget to add custom OG data at the page level where you can assign entire post types to as rules to a specific Open Graph type or specific type of Twitter Cards (<a href=\"https://dev.twitter.com/cards/types\" data-mce-href=\"https://dev.twitter.com/cards/types\">all 7 twitter cards</a> are available and validate).</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"hero_block row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\"headline clearfix text-center\">\n<h3 style=\"font-size:34px;font-family:Open Sans;color:#222222;margin-top:15px;margin-bottom:25px;\"><strong>Global Post Type Customization for Open Graph and Twitter Cards.</strong></h3>\n</div>\n</div>\n<div class=\"col-md-12\">\n<figure class=\"image-module\">\n<div><img src=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/7-Twitter-Card-Types-1200x622.png\" class=\"image-module img-responsive square img-center\" data-no-retina title=\"\" alt=\"Create Valid Twitter Cards with Ease\"></div><figcaption>\n<div class=\"view-more\"><a href=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/7-Twitter-Card-Types-1200x622.png\" class=\"pretty-view clearfix\" data-rel=\"prettyPhoto\">View more</a></div>\n</figcaption></figure>\n</div>\n</div>\n</div>\n</div>\n<div class=\"hero_block row last_row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\"headline clearfix text-center\">\n<h3 style=\"font-size:34px;font-family:Open Sans;color:#222222;margin-top:15px;margin-bottom:25px;\"><strong>The New (Premium) OpenGraph+ Module and 7 New Rich Snippets</strong></h3>\n</div>\n</div>\n<div class=\"col-md-12\">\n<div class=\" text-left\">\n<p>You can also mass edit pages and posts (up to 100 entries at a time and customize unique titles, meta descriptions, Open Graph, Google+, FB and Twitter inputs).</p>\n<p>Now that’s something you can’t do with the FREE version of SEO Ultimate…since it only has rich-snippets for <em>place</em> and <em>review</em> ;( and sorry guys <strong>no new features on the free version from now on</strong>, only bug fixes as all new feature development is moving exclusively the premium version SEO Ultimate+.</p>\n<p>In any case, this is only the beginning and we’ll be adding new features to SEO Ultimate plus, but don’t worry, there’s still plenty of horsepower in the free version (which you can get <a href=\"https://seodesignframework.leadpages.net/seo-ultimate-video-training/\" data-mce-href=\"https://seodesignframework.leadpages.net/seo-ultimate-video-training/\">FREE video training</a> for here). Before we leave, we&#8217;ll let you play the quick and dirty version of the OpenGraph+ Module video.</p>\n</div>\n</div>\n<div class=\"col-md-12\">\n<div class=\" text-center\" style=\"margin-top:35px;margin-bottom:35px;\"><iframe style=\"height: 313px;\" src=\"//fast.wistia.net/embed/iframe/hocfwbb6rd?videoFoam=true\" allowtransparency=\"true\" frameborder=\"0\" scrolling=\"no\" class=\"wistia_embed\" name=\"wistia_embed\" allowfullscreen=\"\" mozallowfullscreen=\"\" webkitallowfullscreen=\"\" oallowfullscreen=\"\" msallowfullscreen=\"\" width=\"650\" height=\"311\"></iframe><script src=\"//fast.wistia.net/assets/external/E-v1.js\"></script></div>\n</div>\n<div class=\"col-md-12\">\n<div class=\" text-left\">\n<p>But, if you haven’t already, let us know what you think by clicking here and <a href=\"https://wordpress.org/support/view/plugin-reviews/seo-ultimate\" data-mce-href=\"https://wordpress.org/support/view/plugin-reviews/seo-ultimate\">leaving us a review on WordPress</a> ;) or you can show your support by purchasing <a href=\"https://www.seoultimateplus.com/product/seo-ultimate-plus/\" data-mce-href=\"https://www.seoultimateplus.com/product/seo-ultimate-plus/\">SEO Ultimate+</a> for its powerful new features, training and support.</p>\n<p>If you&#8217;re looking&nbsp; to build a new site, make sure to try SEO Ultimate&#8217;s companion product the <a href=\"http://www.seodesignframework.com\" data-mce-href=\"http://www.seodesignframework.com\">SEO Design Framework</a>. </p>\n<p>Thanks for stopping in&#8230; since we can&#8217;t read it, let us know what&#8217;s on your mind. </p>\n<p>Leave a comment below or share this post socially to get the word out about <em><strong>our soft launch for SEO Ultimate+ </strong></em>(up, up and away).</p>\n<p>We look forward to hearing from you or you can be stealthy and just <a href=\"https://twitter.com/@jeffrey_smith\" data-mce-href=\"https://twitter.com/@jeffrey_smith\">follow me on twitter</a> instead.</p>\n<p>All the best!</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"feedflare\">\n<a href=\"http://feeds.seodesignsolutions.com/~ff/SeoDesignSolutionsBlog?a=CLbuMSbKLvM:2zGIgKikAM0:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/SeoDesignSolutionsBlog?d=yIl2AUoC8zA\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/SeoDesignSolutionsBlog/~4/CLbuMSbKLvM\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:119:\"http://www.seodesignsolutions.com/blog/wordpress-seo/new-update-plus-seo-ultimate-is-going-premium-up-up-and-away/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:114:\"http://www.seodesignsolutions.com/blog/wordpress-seo/new-update-plus-seo-ultimate-is-going-premium-up-up-and-away/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"The Most Effective YouTube SEO Tactics for Guaranteed Video &amp; Website Traffic\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"http://feeds.seodesignsolutions.com/~r/SeoDesignSolutionsBlog/~3/jEG9LXlzxPI/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"SEO Tips\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Sat, 27 Jun 2015 10:42:57 PDT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"http://www.seodesignsolutions.com/blog/?p=9473\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:498:\"YouTube is by far the most popular video-sharing sites today. Your business stands to benefit greatly from a YouTube presence in that: YouTube only comes after Google &#38; Facebook when it comes to daily visits. Billions of videos are viewed every month on YouTube, meaning there is a very high chance that your video will <a href=\"http://www.seodesignsolutions.com/blog/seo-tips/the-most-effective-youtube-seo-tactics-for-guaranteed-video-website-traffic/\" class=\"read-more-excerpt\">Read More</a>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Guest Post\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:8887:\"<p><img class=\" wp-image-9479 size-full aligncenter\" src=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/oa_youtube_Channels.png\" alt=\"oa_youtube_Channels\" width=\"640\" height=\"428\" srcset=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/oa_youtube_Channels.png 640w, http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/oa_youtube_Channels-300x201.png 300w\" sizes=\"(max-width: 640px) 100vw, 640px\" /></p>\n<p>YouTube is by far the most popular video-sharing sites today. Your business stands to benefit greatly from a YouTube presence in that:</p>\n<ul>\n<li>YouTube only comes after Google &amp; Facebook when it comes to daily visits. Billions of videos are viewed every month on YouTube, meaning there is a very high chance that your video will get many views once you post it.</li>\n<li>You will reach targeted Web traffic. Recent research by Nielsen shows that YouTube gets the most visits from adults aged between 18 and 34.</li>\n<li>It is free to post a video on YouTube, meaning you can put your advertising dollars elsewhere.</li>\n<li>Your YouTube campaign will help you get a more targeted mailing list by asking people who view your videos to sign up to your mailing list. People who have viewed and liked your videos are more likely to buy from you (and to recommend your company/products to their friends).</li>\n<li>You will be able to demonstrate products, which is particularly important if your physical distribution channel is limited.</li>\n<li>If you want to build a community for your business or the business already has a community, YouTube videos are a tool to engage and share with customers. As an example, you could have video blogs or event footage for your customers if you are a bicycle retailer.</li>\n<li>YouTube will help you build your reputation as a guru in your field. You could post such things as video tutorials.</li>\n</ul>\n<h3><strong>Effective YouTube SEO Tactics Include</strong></h3>\n<p><img class=\" wp-image-9480 size-full aligncenter\" src=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/youtube-marketing.jpg\" alt=\"youtube-marketing\" width=\"730\" height=\"305\" srcset=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/youtube-marketing.jpg 730w, http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/youtube-marketing-300x125.jpg 300w\" sizes=\"(max-width: 730px) 100vw, 730px\" /></p>\n<p><strong>1)</strong> Google’s Universal Search blends videos, images, books, news, and local searches in the search engine’s search results. This shows that Google values videos as much as it does text pages. Videos hosted on YouTube will help you reach many people.</p>\n<p><strong>2)</strong> The fact that there are millions of videos on YouTube poses a challenge in that you will be competing with very many videos. If you want improved visibility, consider running a YouTube search engine optimization (<a href=\"http://www.seodesignsolutions.com\">SEO</a>) campaign. Several SEO tactics will greatly increase the visibility of your video.</p>\n<p><strong>3)</strong> YouTube allows you to include a video description for every video. Since Google and YouTube cannot listen or watch your video yet, they rely on the description to understand the topic of your video. The description should be keyword-optimized. Take all other precautions you would with other search engine optimized text (such as ensuring the content is unique).</p>\n<p><strong>4)</strong> Consider optimizing around “video keywords.” Note that although YouTube videos have an edge on Google’s SERP, this is only true for some keywords. These are called “Video Keywords.” As an example, you expect a few video results when you use the keyword “cute cats” (which makes sense since the person who searches for this keyword is most likely looking for a video, not an article on cute cats). On the other hand, someone searching for the keyword “muscle aches” is most likely looking for an article.</p>\n<p><strong>5)</strong> A proven YouTube SEO tactic is getting your videos to online communities. You can achieve this by sharing your YouTube videos on these communities. Online communities comprise of people who have similar interests and so you will get more high-retention traffic if you find the right community.</p>\n<p><strong>6)</strong> YouTube algorithm values user experience signals because it does not use backlinks. You should therefore ensure your videos are interesting since subscribing and liking are the most important YouTube user experience signals, in that order. Simply asking people to like, subscribe, share, and/or share is an effective way of achieving this.</p>\n<p><strong>7)</strong> Consider creating playlists and ensure they are keyword-rich. Organize your YouTube channel and you will realize more YouTube traffic. YouTube gets deeper info about the topics of your videos from keyword-rich playlists.</p>\n<p><strong>8)</strong> The name of the video should have the word “video” whenever possible and it should include an appropriate keyword. This is because most people search for videos using keywords and include the word “video” after the keyword.</p>\n<p><strong>9)</strong> You should watermark your videos. The best video editing software programs allow you to place small translucent logos in the corner of your videos. Watermarks help give more credibility to your videos.</p>\n<p><strong>10)</strong> Advertise your channel on your website, your blog, on article submission directories, and everywhere else possible because the more channel views you get, the higher it will rank in its niche.</p>\n<p><strong>11)</strong> You could create different accounts and comment on the videos to get things rolling (never attempt to do this using a single account since YouTube considers this a Grey Hat SEO tactic). Consider enticing some drama since people like flocking to conflict.</p>\n<p><strong>12)</strong> YouTube considers the number of dislikes when ranking videos and you should, therefore take pre-emptive action when you start receiving negative feedback. It might be necessary to bring down your video to ensure it does not give your channel a bad name.</p>\n<p><strong>13)</strong> Link building remains one of the most effective SEO tactics. You should therefore consider having links to your website in the video description. This not only helps your SEO efforts, but it also gives you targeted web traffic.</p>\n<p><strong>14)</strong> Give views more options by including audio cues and illustrations over and above video and text. This increases the overall engagement the video receives since you will be catering to varying learning styles.</p>\n<h3><strong>Other Helpful Tips</strong></h3>\n<p><img class=\"aligncenter wp-image-9481 size-full\" src=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/youtube-analytics-banner.jpg\" alt=\"youtube-analytics-banner\" width=\"600\" height=\"292\" srcset=\"http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/youtube-analytics-banner.jpg 600w, http://www.seodesignsolutions.com/blog/wp-content/uploads/2015/06/youtube-analytics-banner-300x146.jpg 300w\" sizes=\"(max-width: 600px) 100vw, 600px\" /></p>\n<p>YouTube Insights is an analytics feature that gives you such information as demographics and the point at which people stopped watching a particular video. This data will help you produce better videos in the future.</p>\n<p>YouTube uses thumbnails to help people who are searching through videos. It takes these thumbnails from the ¼, ½, and ¾ marks. Choose the most appropriate thumbs to display. You could try to manipulate videos (if this will not be disruptive) for you to get the most compelling images at these points. Thumbnails greatly affect the click-through rate.</p>\n<p>Combine SEO with other website promotion tactics such as article submission for the best results.</p>\n<p>Consider such things as the length and quality of your video as this determines if your audience will watch the video to the end.</p>\n<p><strong>Author Bio:</strong> Lalit Sharma is an SEO consultant who runs a SEO house called <a href=\"http://www.rankingbyseo.com/seo-services-india.html\" rel=\"nofollow\">Ranking By SEO</a>. He is specialized in link building and other SEO related activities. You can also find him on <a href=\"https://twitter.com/rankingbyseo\" rel=\"nofollow\">Twitter</a>, <a href=\"https://plus.google.com/+LalitSharma/posts\" rel=\"nofollow\">Google+</a> and his personal blog.</p>\n<p>&nbsp;</p>\n<div class=\"feedflare\">\n<a href=\"http://feeds.seodesignsolutions.com/~ff/SeoDesignSolutionsBlog?a=jEG9LXlzxPI:HqIcsUcjkvU:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/SeoDesignSolutionsBlog?d=yIl2AUoC8zA\" border=\"0\"></img></a>\n</div><img src=\"http://feeds.feedburner.com/~r/SeoDesignSolutionsBlog/~4/jEG9LXlzxPI\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s