(12, 1, '2018-11-22 10:43:58', '2018-11-22 07:43:58', 'В ООО «СтройКомфорт»представлен большой ассортимент продукции, завоевавших отличную репутацию на рынке. которые имеются в продаже, производятся в соответствии с государственными стандартами.\r\n\r\nВ наличии большие запасы строительных материалов, готовых к отправке в любой день. Поэтому у клиентов есть возможность приобрести стройматериалы оптом и в розницу, в любых объемах.\r\n\r\nВЫГОДНЫЕ УСЛОВИЯ СОТРУДНИЧЕСТВА\r\n\r\nС компанией сотрудничают по многим причинам:\r\n\r\nМы занимаемся строительством и ремонтом загородных домов с гарантией качества!\r\n\r\nНаличие партнерского производства позволяет осуществлять закупки надежных стройматериалов по низким ценам.\r\n\r\nООО «СтройКомфорт» сотрудничаем с ведущими поставщиками, которые выпускают экологически чистую продукцию.\r\n\r\nКомпания возводит дома в соответствии с установленным графиком работ. График согласовывается на этапе подписания договора. Каждую неделю постройки проверят инженеры или прорабы;\r\n\r\nСотрудники «Стройкомфорт» – квалифицированные специалисты, которые прошли специальную подготовку и имеют за плечами большой опыт. Они постоянно повышают свою квалификацию, обучаясь новейшим строительным технологиям.\r\nДля сокращения сроков работы, регулярно обновляется парк спецтехники;\r\n\r\nДоступные цены. Обозначенная стоимость работ остается неизменной на протяжении всего процесса строительства;\r\n\r\nКаждый объект, возведенный специалистами ООО «СтройКомфорт, продуман до мелочей и соответствует европейским стандартам качества!\r\n\r\nудобное оформление заказа.\r\nЗаказ строительных материалов занимает всего несколько мину\r\n\r\nООО «Стройкомфорт» — это выбор тысячи жильцов коттеджных поселков!', 'Главная страница', '', 'publish', 'closed', 'closed', '', '%d0%b3%d0%bb%d0%b0%d0%b2%d0%bd%d0%b0%d1%8f-%d1%81%d1%82%d1%80%d0%b0%d0%bd%d0%b8%d1%86%d0%b0', '', '', '2018-11-22 10:57:20', '2018-11-22 07:57:20', '', 0, 'http://wordpress/?page_id=12', 0, 'page', '', 0),
(13, 1, '2018-11-22 10:43:58', '2018-11-22 07:43:58', 'ООО «СтройКомфорт» была основана в 2011 г. в городе мастеров – Туле. Сегодня компания строит деревянные дачные дома и бани в Московской, Тульской, Калужской, Рязанской, Орловской и Липецкой областях.\r\n\r\nОсновная цель деятельности - удовлетворение ростущей потребности российского рынка в быстровозводимых домах для круглогодичного проживания и их строительство по доступным ценам.\r\n\r\nДля этого сотрудники компании «СтройКомфорт» постоянно следят за всеми тенденциями рынка малоэтажного домостроения и стараются подобрать оптимальный проект для каждого клиента.\r\n\r\nНесмотря на молодой возраст компании, опыт и профессиональные знания сотрудников являются большим преимуществом.\r\n\r\nСтроительные бригады формируются из опытных специалистов, поэтому работают они достаточно быстро, качественно и за очень разумные деньги. Строительные бригады — настоящие профессионалы в деле строительства домов из бруса. При строительстве деревянных домов и бань из бруса, используются только качественные, экологически чистые строительные материалы, поэтому в построенных домах безопасно, комфортно и уютно. Помимо этого, осуществляется строительство бань и домов по индивидуальным проектам любой планировки и сложности.\r\n\r\nВ компании работают, как молодые дипломированные специалисты в области проектирования и строительства, так и уже опытные сотрудники, имеющие за плечами огромный опыт советской школы домостроения.\r\n\r\nНа сегодняшний день клиентами компании стали более 1 000 счастливых обладателей домов, бань, пристроек и фундаментов строений. Многие из клиентов поделились положительным отзывом о работе строительных бригад.\r\n\r\nОсновной материал, который использует компания - это доска хвойных пород деревьев, которая закупается у партнеров в Новгородской, Пермской, Кировской областях уже на протяжении 5 лет.\r\n\r\nОсновная миссия компании – максимально полное удовлетворение спроса своих клиентов, желающих создать уютное и практичное интерьерное пространство.', 'О нас', '', 'publish', 'closed', 'closed', '', 'o-nas', '', '', '2018-11-23 08:46:32', '2018-11-23 05:46:32', '', 0, 'http://wordpress/?page_id=13', 0, 'page', '', 0),
(14, 1, '2018-11-22 10:43:58', '2018-11-22 07:43:58', 'Это страница с основной контактной информацией, такой как адрес и номер телефона. Вы также можете попробовать добавить форму контактов с помощью плагина.', 'Контакты', '', 'publish', 'closed', 'closed', '', 'contacts', '', '', '2018-11-23 08:46:17', '2018-11-23 05:46:17', '', 0, 'http://wordpress/?page_id=14', 0, 'page', '', 0),
(16, 1, '2018-11-22 10:43:58', '2018-11-22 07:43:58', 'ООО «СтройКомфорт» предоставляет широкий спектр услуг:\r\n\r\n1.Проектирование домов.\r\nСамое главное заключается в том, чтобы разработанный проект строительства дома создавался опираясь на следующие принципы:\r\nМножественная функциональность – то есть, возведенный дом по этому проекту будет удобен и практичен во всех отношениях. Проект дома своими руками должен быть не хуже архитекторского;\r\nПростота конструкции – сделать проект дома несложно будет только в том случае, если он не будет предполагать каких-либо изысков. Создание какого-то особо сложного проекта, реализация которого потребует огромного количества творческих изысков, человеку, не имеющему специального образования, крайне не рекомендуется, ибо можно не учесть некоторые принципиально важные вещи;\r\nЭстетичность – конечно же, дом должен выглядеть красиво и радовать взор своих хозяев. Проект надежного дома должен быть еще и эффектным!\r\n\r\n2.Монтаж фундамента.\r\nООО «СтройКомфорт» оказывает услуги в заливке фундамента на территории Тульской области. Сотрудники рады приветствовать всех желающих заказать комплексное строительство «под ключ» или отдельно взятый этап работ.В своей деятельности компания руководствуется ответственным отношением к делу и безупречным выполнением поставленных задач. На каждой стадии осуществления строительных работ специалисты ООО «СтройКомфорт» пристально контролируют все процессы, осознавая важность таких показателей как надежность, прочность, долговечность. Взаимодействуя с заказчиками, сотрудники оперируют реальными цифрами, предельно четкими замерами и оптимальными коэффициентами затрат. Строя фундаменты для жилых и промышленных зданий, компания строго придерживается нормативов СНиП и ГОСТ.\r\n\r\n3.Строительство домов.\r\nООО «СтройКомфорт» работает на строительном рынке с 2011 года. За время специалистами было разработано большое количество проектов, реализованных в Туле. Компания предлагает широкий выбор готовых проектов, реализация которых позволяет возводить загородные дома высокого качества исполнения, привлекательного дизайна и практичности в эксплуатации. Новый проект разрабатывается за короткий срок и передается на согласование клиенту. После этого начинается подготовка к строительству частного дома. Специалисты компании имеют большой опыт, что позволяет строить дома в соответствии с проектной документацией в максимально короткие сроки и высокого качества.\r\n\r\n4.Коммуникации в доме. Проектирование и монтаж под ключ.\r\nООО «СтройКомфорт» выполняет весь спектр работ на рынке инженерных систем и коммуникаций. Комплексный подход к объекту является приоритетным для компании. Заказывая услугу, инженерные коммуникации под ключ заказчик определяет задачу и бюджет, остальную работу специалисты компании берут на себя.\r\n\r\n5. Рекуперация воздуха.\r\nПрофессионалы ООО «СтройКомфорт» подоберут оптимальные наборы вентиляционных приборов, чтобы на 100% обеспечить чистый воздух в доме без переплат!\r\n\r\n6. Продажа бруса для строительства дома.\r\nУ ООО «СтройКомфорт» можно приобрести любой брус для строительства, с учетом самых доступных цен. Брус компании это прочный, надежный и крепкий материал, который можно с легкостью использовать для строительства, как одноэтажных зданий, так и многоэтажных, все зависит от предпочтений каждого отдельно взятого человека.', 'Спектр услуг', '', 'publish', 'closed', 'closed', '', '%d1%80%d0%b0%d0%b7%d0%b4%d0%b5%d0%bb-%d0%b3%d0%bb%d0%b0%d0%b2%d0%bd%d0%be%d0%b9-%d1%81%d1%82%d1%80%d0%b0%d0%bd%d0%b8%d1%86%d1%8b', '', '', '2018-11-22 10:54:55', '2018-11-22 07:54:55', '', 0, 'http://wordpress/?page_id=16', 0, 'page', '', 0),
