(158, 1, '2018-11-22 13:29:58', '2018-11-22 10:29:58', '<h1 style=\"text-align: center;\">Дома из бруса.</h1>\r\n<p style=\"padding-left: 60px;\">Дома из бруса обладают главным достоинством – они способны «дышать» и удерживать тепло лучше, чем дома, построенные из камня. В таких домах создаётся более благоприятный для человека микроклимат. Дома из клееного бруса, или дома из соснового прорфилированного бруса неоспоримо, имеют очень красивый вид. Однако вышеупомянутые достоинства свойственны только правильно спроектированным и построенным домам из бруса, а также соответствующим всем требованиям к проектированию и возведению таких строений.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Строительство брусовых домов под ключ предполагает применение хвойных пород: ели, лиственницы, сосны, пихты, кедра. А несущие конструкции создают из более подходящих для этого пород - сосны и лиственницы, которые в отличие от пихты и ели подвержены гниению в меньшей степени. В Европе самым доступным и распространённым строительным материалом стала сосна. Лиственные породы дерева используются нечасто, из них предпочтение отдаётся дубу, буку, берёзе, ясеню, осине.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Древесина по своей структуре – это природный полимер, он образуется клетками-волокнами, которые направлены вдоль ствола дерева и обладают трубчатой формой. Поэтому ей свойственен целый ряд достоинств: исключительно высокая прочность, упругость, низкая теплопроводность, устойчивость к химическим агрессивным средам, низкая плотность и вес, природная декоративность и, что немаловажно, простата обработки и монтажа. Отдельно стоит отметить низкую теплопроводность дерева, так как чем ниже её значение, тем теплее будет в доме зимой, и прохладнее летом.</p>', 'Дома из бруса', '', 'publish', 'open', 'open', '', '158', '', '', '2018-11-22 13:37:37', '2018-11-22 10:37:37', '', 0, 'http://wordpress/?p=158', 0, 'post', '', 0),
