(162, 1, '2018-11-22 13:32:08', '2018-11-22 10:32:08', '<h1 style=\"text-align: center;\">Дома из клееного бруса.</h1>\r\n<p style=\"padding-left: 60px;\">Это на сегодняшний день самый оптимальный вариант для всех тех, кто мечтает о собственном уютном жилье. Использование при строительстве деревянных домов такого строительного материала, как клееный брус, придает дому или бане очень привлекательный и достаточно оригинальный внешний вид. Все дома из клееного бруса очень эффектно выделяются на фоне всех других построек.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Клееный брус не подвергаются дальнейшей деформации в ходе их эксплуатации. Помимо этого, он не пропускают влагу и имеют пониженную теплопроводность. Все эти факторы, без сомнений, ведут к формированию комфортного и благоприятного микроклимата в доме из клееного бруса, а так же повышают интерес к использованию бруса в качестве основного строительного материала.</p>', 'Дома из клееного бруса.', '', 'publish', 'open', 'open', '', '%d0%b4%d0%be%d0%bc%d0%b0-%d0%b8%d0%b7-%d0%ba%d0%bb%d0%b5%d0%b5%d0%bd%d0%be%d0%b3%d0%be-%d0%b1%d1%80%d1%83%d1%81%d0%b0', '', '', '2018-11-22 13:37:29', '2018-11-22 10:37:29', '', 0, 'http://wordpress/?p=162', 0, 'post', '', 0),
(163, 1, '2018-11-22 13:32:08', '2018-11-22 10:32:08', '<h1 style=\"text-align: center;\">Дома из клееного бруса.</h1>\r\n<p style=\"padding-left: 60px;\">Это на сегодняшний день самый оптимальный вариант для всех тех, кто мечтает о собственном уютном жилье. Использование при строительстве деревянных домов такого строительного материала, как клееный брус, придает дому или бане очень привлекательный и достаточно оригинальный внешний вид. Все дома из клееного бруса очень эффектно выделяются на фоне всех других построек.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">\r\nКлееный брус не подвергаются дальнейшей деформации в ходе их эксплуатации. Помимо этого, он не пропускают влагу и имеют пониженную теплопроводность. Все эти факторы, без сомнений, ведут к формированию комфортного и благоприятного микроклимата в доме из клееного бруса, а так же повышают интерес к использованию бруса в качестве основного строительного материала.</p>', 'Дома из клееного бруса.', '', 'inherit', 'closed', 'closed', '', '162-revision-v1', '', '', '2018-11-22 13:32:08', '2018-11-22 10:32:08', '', 162, 'http://wordpress/2018/11/22/162-revision-v1/', 0, 'revision', '', 0),
(164, 1, '2018-11-22 13:32:40', '2018-11-22 10:32:40', '<h1 style=\"text-align: center;\">Дома из профилированного бруса.</h1>\r\n<p style=\"padding-left: 60px;\">Профилированный брус позволяет немедленно приступить к строительным работам по возведению дома или бани, при условии готовности фундамента. Профилированный клееный брус производится из хвойных пород дерева, которые дают незначительную усадку в течение первого полугодия. Построенные таким образом деревянные дома без каких либо проблем переносят естественную минимальную деформацию фундамента и срок их эксплуатации превышает 150 лет.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Дома из профилированного бруса уже давно зарекомендовали себя с самых лучших сторон в условиях средней полосы, т.к. они обладают такими качествами как прочность, долговечность и имеют сравнительно низкую стоимость строительства. Дома из клееного бруса используют как в качестве летних дачных домов, так и для постоянного проживания. Так же не забываем о том, что деревянные дома из бруса строятся очень быстро и готовы для проживания сразу после окончания строительства.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Отделка дома из профилированного бруса не отнимает много времени и отличается своей дешевизной, так как профилированный брус превосходно смотрится как снаружи, так и изнутри дома или бани. Несомненно, городские жители хотят свои загородные дома снабдить всеми современными удобствами и возможными коммуникациями.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Необходимо отметить, что именно дома из профилированного бруса позволяют очень быстро и достаточно эффективно воплотить все задуманные действия: провести все внутренние коммуникации: водопровод, канализацию, отопление, а так же сделать монтаж теплых полов, и пр. Дома из бруса отличаются большим разнообразием форм, планировок и размеров, и при этом для них не требуется возводить какой либо сложный и дорогой фундамент.</p>', 'Дома из профилированного бруса.', '', 'publish', 'open', 'open', '', '%d0%b4%d0%be%d0%bc%d0%b0-%d0%b8%d0%b7-%d0%bf%d1%80%d0%be%d1%84%d0%b8%d0%bb%d0%b8%d1%80%d0%be%d0%b2%d0%b0%d0%bd%d0%bd%d0%be%d0%b3%d0%be-%d0%b1%d1%80%d1%83%d1%81%d0%b0', '', '', '2018-11-22 13:37:12', '2018-11-22 10:37:12', '', 0, 'http://wordpress/?p=164', 0, 'post', '', 0),
(165, 1, '2018-11-22 13:32:40', '2018-11-22 10:32:40', '<h1 style=\"text-align: center;\">Дома из профилированного бруса.</h1>\r\n<p style=\"padding-left: 60px;\">Профилированный брус позволяет немедленно приступить к строительным работам по возведению дома или бани, при условии готовности фундамента. Профилированный клееный брус производится из хвойных пород дерева, которые дают незначительную усадку в течение первого полугодия. Построенные таким образом деревянные дома без каких либо проблем переносят естественную минимальную деформацию фундамента и срок их эксплуатации превышает 150 лет.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">\r\nДома из профилированного бруса уже давно зарекомендовали себя с самых лучших сторон в условиях средней полосы, т.к. они обладают такими качествами как прочность, долговечность и имеют сравнительно низкую стоимость строительства. Дома из клееного бруса используют как в качестве летних дачных домов, так и для постоянного проживания. Так же не забываем о том, что деревянные дома из бруса строятся очень быстро и готовы для проживания сразу после окончания строительства.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">\r\nОтделка дома из профилированного бруса не отнимает много времени и отличается своей дешевизной, так как профилированный брус превосходно смотрится как снаружи, так и изнутри дома или бани. Несомненно, городские жители хотят свои загородные дома снабдить всеми современными удобствами и возможными коммуникациями.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">\r\nНеобходимо отметить, что именно дома из профилированного бруса позволяют очень быстро и достаточно эффективно воплотить все задуманные действия: провести все внутренние коммуникации: водопровод, канализацию, отопление, а так же сделать монтаж теплых полов, и пр. Дома из бруса отличаются большим разнообразием форм, планировок и размеров, и при этом для них не требуется возводить какой либо сложный и дорогой фундамент.</p>', 'Дома из профилированного бруса.', '', 'inherit', 'closed', 'closed', '', '164-revision-v1', '', '', '2018-11-22 13:32:40', '2018-11-22 10:32:40', '', 164, 'http://wordpress/2018/11/22/164-revision-v1/', 0, 'revision', '', 0),
(166, 1, '2018-11-22 13:35:21', '2018-11-22 10:35:21', '<h1 style=\"text-align: center;\">Каркасные дома.</h1>\r\n<p style=\"padding-left: 60px;\">Современные технологии строительства каркасных домов позволяют возводить строения, не уступающие домам из кирпича или бетона как в надежности, так в прочности и долговечности. При этом каркасные дома и каркасное строительство по типовым проектам имеют целый ряд преимуществ, таких как:</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Высокая скорость возведения дома и относительно малая стоимость строительных работ.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Малая вероятность того, что дом будет поврежден, вследствие конструктивных недочетов или «капризного» грунта. Так как предельно низкий вес каркасных домов, в сочетании с очень жесткими строительными материалами (OSB, ЦСП или СМЛ), позволяет создавать каркасные конструкции менее подверженные разрушениям из-за особенностей грунта или собственного веса строящегося каркасного дома.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Круглогодичная отделка — отсутствие, так называемых, «мокрых» процессов при строительстве каркасного дома, позволяют проводить как внешнюю, так и внутреннюю отделку в любое время года, в том числе и зимой. А изначально ровные поверхности упрощают отделку каркасного дома.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Малый вес конструкций каркасного дома не требует сооружения массивного и дорогостоящего фундамента. На практике, каркасные дома строятся на достаточно легких и совсем недорогих фундаментах, а именно: это может быть мелкозаглублённый ленточный фундамент, фундаментная шведская плита, буронабивные сваи или свайно-винтовой фундамент из металлических свай. Современные защитные покрытия, наносимые на винтовых свай от коррозии в виде полимерных составов, позволяют создавать свайные фундаментные поля не только быстро и дешево, но и порой долговечнее, если сравнивать с каменными или бетонными. Каркасные дома зачастую имеют настолько малую монтажную массу, что могут быть просто подняты несколькими домкратами без разрушения несущей конструкции каркасного дома.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Каркасные дома идеально подходят для постоянного проживания. В холодное время года они быстро прогреваются до комфортной температуры, и стоимость отопления таких домов значительно дешевле, поскольку каркасные дома имеют низкую теплопроводность стен и перекрытий, и с другой стороны высокую теплозащиту.\r\nТехнология строительства каркасных домов позволяет создавать самые смелые и разнообразные архитектурные формы, и значительное перераспределение веса каркасной конструкции, обычно не приводит к каким либо проблемам, связанными с надежностью конструкции.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Пожарная безопасность. При подготовке проекты каркасных домов, каркасные дома имеют даже более надежную степень пожарной безопасности, чем дома с кирпичными стенами, так как надежно и достаточно эффективно препятствуют процессам горения.\r\n«Дышащий дом». При правильной строительной конструкции, каркасные дома, в строительстве которых используются паропроницаемые материалы внешней обшивки (ЦСП, СМЛ, ДВП), и соответствующий вид утеплителя (минеральная вата, базальтовая вата), возможно создание совершенно паропроницаемых стен, что создает так называемый эффект «дышащего дома», который присущ классическим деревянным домам. Поскольку паропроницаемые стены выводят избыточную влажность из каркасного дома даже без проветривания, что создает достаточно комфортный микроклимат в помещении.</p>', 'Каркасные дома.', '', 'publish', 'open', 'open', '', '%d0%ba%d0%b0%d1%80%d0%ba%d0%b0%d1%81%d0%bd%d1%8b%d0%b5-%d0%b4%d0%be%d0%bc%d0%b0', '', '', '2018-11-22 13:36:56', '2018-11-22 10:36:56', '', 0, 'http://wordpress/?p=166', 0, 'post', '', 0),
