(169, 1, '2018-11-22 13:37:12', '2018-11-22 10:37:12', '<h1 style=\"text-align: center;\">Дома из профилированного бруса.</h1>\r\n<p style=\"padding-left: 60px;\">Профилированный брус позволяет немедленно приступить к строительным работам по возведению дома или бани, при условии готовности фундамента. Профилированный клееный брус производится из хвойных пород дерева, которые дают незначительную усадку в течение первого полугодия. Построенные таким образом деревянные дома без каких либо проблем переносят естественную минимальную деформацию фундамента и срок их эксплуатации превышает 150 лет.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Дома из профилированного бруса уже давно зарекомендовали себя с самых лучших сторон в условиях средней полосы, т.к. они обладают такими качествами как прочность, долговечность и имеют сравнительно низкую стоимость строительства. Дома из клееного бруса используют как в качестве летних дачных домов, так и для постоянного проживания. Так же не забываем о том, что деревянные дома из бруса строятся очень быстро и готовы для проживания сразу после окончания строительства.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Отделка дома из профилированного бруса не отнимает много времени и отличается своей дешевизной, так как профилированный брус превосходно смотрится как снаружи, так и изнутри дома или бани. Несомненно, городские жители хотят свои загородные дома снабдить всеми современными удобствами и возможными коммуникациями.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Необходимо отметить, что именно дома из профилированного бруса позволяют очень быстро и достаточно эффективно воплотить все задуманные действия: провести все внутренние коммуникации: водопровод, канализацию, отопление, а так же сделать монтаж теплых полов, и пр. Дома из бруса отличаются большим разнообразием форм, планировок и размеров, и при этом для них не требуется возводить какой либо сложный и дорогой фундамент.</p>', 'Дома из профилированного бруса.', '', 'inherit', 'closed', 'closed', '', '164-revision-v1', '', '', '2018-11-22 13:37:12', '2018-11-22 10:37:12', '', 164, 'http://wordpress/2018/11/22/164-revision-v1/', 0, 'revision', '', 0),
(170, 1, '2018-11-22 13:37:29', '2018-11-22 10:37:29', '<h1 style=\"text-align: center;\">Дома из клееного бруса.</h1>\r\n<p style=\"padding-left: 60px;\">Это на сегодняшний день самый оптимальный вариант для всех тех, кто мечтает о собственном уютном жилье. Использование при строительстве деревянных домов такого строительного материала, как клееный брус, придает дому или бане очень привлекательный и достаточно оригинальный внешний вид. Все дома из клееного бруса очень эффектно выделяются на фоне всех других построек.</p>\r\n\r\n\r\n<hr />\r\n<p style=\"padding-left: 60px;\">Клееный брус не подвергаются дальнейшей деформации в ходе их эксплуатации. Помимо этого, он не пропускают влагу и имеют пониженную теплопроводность. Все эти факторы, без сомнений, ведут к формированию комфортного и благоприятного микроклимата в доме из клееного бруса, а так же повышают интерес к использованию бруса в качестве основного строительного материала.</p>', 'Дома из клееного бруса.', '', 'inherit', 'closed', 'closed', '', '162-revision-v1', '', '', '2018-11-22 13:37:29', '2018-11-22 10:37:29', '', 162, 'http://wordpress/2018/11/22/162-revision-v1/', 0, 'revision', '', 0),
